import React, { Component } from 'react';

import Header from '../components/Header'
import Footer from '../components/Footer'

class About extends Component {
  state = {  }
  render() {
    return (
      <div>
        <Header />
        <section id="gallery">
          <div className="content pt-5 bg">
            <div class="container">
              <div class="row">
                <div class="col-lg-4 mb-4">
                  <div class="card border-info">
                    <img class="card-img-top" src="https://media.licdn.com/dms/image/C5603AQGfktbmMtp0JQ/profile-displayphoto-shrink_800_800/0?e=1556150400&v=beta&t=aD4wJgqh63y6EMlL46FX3SSChZCaCiIngy63PjGnhLk" alt="logo" />
                    <div class="card-body">
                      <h5 class="card-title">Payam Rafiee</h5>
                      <p class="card-text text-secondary">
                        The co-founder and CEO of Home360.
                        BSc in Mathematics from Shiraz University.
                        Full-Stack Developer and Data Scientist.
                      </p>
                      <a href="https://www.linkedin.com/in/payamrafiee/" class="btn btn-outline-primary btn-sm mr-3"><i class="fab fa-linkedin-in"></i></a>
                      <a href="https://twitter.com/payamrafiee92" class="btn btn-outline-info btn-sm"><i class="fab fa-twitter"></i></a>
                    </div>
                  </div>
                </div>
                <div class="col-lg-4 mb-4">
                  <div class="card border-info">
                    <img class="card-img-top" src="https://media.licdn.com/dms/image/C5603AQGD5afI3fl4FQ/profile-displayphoto-shrink_800_800/0?e=1556150400&v=beta&t=8GFOrhW4vdqh7NkGkiKF64WAWa-mFEOxeGA53lqKlgY" alt="" />
                    <div class="card-body">
                      <h5 class="card-title">Mohammad Nazari</h5>
                      <p class="card-text font-b">
                        The co-founder and CEO of Home360.
                        BSc in Mathematics from Shiraz University.
                        Full-Stack Developer and Data Scientist.
                      </p>
                      <a href="https://www.linkedin.com/in/ryan-nazari-145529167/" class="btn btn-outline-primary btn-sm mr-3"><i class="fab fa-linkedin-in"></i></a>
                      <a href="https://twitter.com/ryannazari21" class="btn btn-outline-info btn-sm"><i class="fab fa-twitter"></i></a>
                    </div>
                  </div>
                </div>
                <div class="col-lg-4 mb-4">
                  <div class="card border-info">
                    <img class="card-img-top" src="https://media.licdn.com/dms/image/C5603AQHOnW0aWW22WA/profile-displayphoto-shrink_800_800/0?e=1556150400&v=beta&t=hfeoDTd85-RL4nDzp5blUUv6zWxanZjZ4DXlZCPmwC8" alt="" />
                    <div class="card-body">
                      <h5 class="card-title">Maryam Rafiee</h5>
                      <p class="card-text text-secondary">
                        The co-founder and CEO of Home360.
                        BSc in Mathematics from Shiraz University.
                        Full-Stack Developer and Data Scientist.
                      </p>
                      <a href="https://www.linkedin.com/in/maryam-rafiee-024259138/" class="btn btn-outline-primary btn-sm mr-3"><i class="fab fa-linkedin-in"></i></a>
                      <a href="https://twitter.com/rafieemaryam" class="btn btn-outline-info btn-sm"><i class="fab fa-twitter"></i></a>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
        <Footer />
        <style jsx>{`
          .bg {
            // background: white;
          }

          .font-l {
            font-family: Open Sans;
            font-weight: 300;
          }

          .font-r {
            font-family: Open Sans;
            font-weight: 400;
          }

          .font-b {
            font-family: Open Sans;
            font-weight: 600;
          }

          .content {
            height: 100vh;
          }
        `}</style>
      </div>
    );
  }
}

export default About;
